import React from 'react';

function AboutMe() {
  return (
    <div className='about aboutTitle'>
      <h1>Hey,&nbsp;I'm Nathan</h1>
      <p className='aboutBio'>
        I grew up and currently live in &nbsp;
        <a href='https://en.wikipedia.org/wiki/Charlotte,_North_Carolina'>
           Charlotte, NC
          </a>
          , and I have two wonderful cats. I graduated in May 2020 from &nbsp;
          <a href='https://www.providenceday.org/'>
          Providence Day School
          </a>
          , and obtained a certificate from the &nbsp;
          <a href='https://www.charlotte.edu/'>
          University of North Carolina at Charlotte
          </a>
          &nbsp; in Full Stack Web Development in November 2022.
           <br></br>
           <br></br>
           I have a passion for constantly learning, and making new ways to simplify assorted tasks.
           <br></br>
           <br></br>
           Feel free to reach out to me on &nbsp;
           <a href='https://www.linkedin.com/in/nathanhawk620/'>LinkedIn</a>
           , or check out some of my work on &nbsp;
           <a href='https://github.com/nathanhawk2'>GitHub</a>
           , as well as my most recently updated &nbsp;
           <a href='nothing yet'>resume</a>.
      </p>
    </div>
  )
};

export default AboutMe;
